INSERT INTO eZArticle_Article VALUES (3,'Features in eZ publish 2.2','<?xml version=\"1.0\"?><article><generator>qdom</generator>\n<intro>eZ publish&amp;trade; version 2.2 offers great improvements since version 2.1. The highlights include: PostgreSQL support, template based tags in eZ article and eZ trade, user defined article/trade tags, dynamic form creation, support for media files ( flash, quick time, mpeg etc ) and section support.</intro><body><page><header level=\"1\">Full changelog since 2.1</header>\r\n<bullet>\r\nAdded support for radiobuttons, checkboxes, dropdown lists and multiple choice lists\r\nSearch in contact now searches in online addresses and phone numbers\r\nFixed Bug count, bug archive on user side.\r\nFixed Bulkmail user login\r\nAdded sections to eZ trade\r\nAdded a better VAT system i eZ trade\r\nAdded voucher view\r\nAdded order list/view for customers\r\nAdded a more complete cart and checkout\r\nAdded SQL admin in sitemanager\r\nAdded fulltext search in eZ forum\r\nFixed search on keywords in article\r\nAdded basic editor for templates in admin.\r\nAdded customer list and customer details in eZ trade.\r\nAdded support for multiple keywords in url translator.\r\nAdded section support with Sitedesign, Template and Language override.\r\nFixed problems with articles being stored with invalid XML\r\nAdded topic link from article list and article view\r\nAdded modification sorting on article categories.\r\nAdded image caption override tag\r\nAdded better search in eZ article. Now handles stop words and word freqyency.\r\nFixed problems with searching in eZ filemanager\r\nAdded setting to set if a user can see the calendar of every user\r\nAdded setting to mage consultations visible for everyone\r\nAdded posibility to add an appointment for an entire day in the calendar\r\nAdded setting to make consultations visible for everyone\r\nAdded upload permission setting to eZ filemanager folders and eZ imagecatalogue categories.\r\nAdded buttons for buy and file folder in person/company list\r\nAdded display of which articles/products an image is used in\r\nAdded mime types for known office documents in filemanger\r\nAdded copy of article categories in admin\r\nAdded topic list on user site\r\nAdded search in eZ imagecatalogue\r\nAdded support for IP or Cookie based vote checking in eZ poll\r\nAdded support for custom defined article tags in site.ini\r\nAdded XML generator/renderer support in eZ trade\r\nAdded circular categories in eZ article\r\nAdded option for keeping case of manual keywords for eZ article\r\nAdded support for changing message limit in eZ forum and eZ mail\r\nAdded Signature in eZMail, fixed Preview button bug.\r\nAdded auto check mail, show unread mail features in eZMail (user configurable)\r\nAdded caching in eZ calendar\r\nAdded next/previous in file list in eZ filemanager\r\nAdded vouchers to eZ trade\r\nAdded support for editors group in eZ article\r\nAdded new module eZ mediacatalogue; handles flash, movies etc..\r\nAdded override system for article list and article view templates.\r\nAdded discussion to polls\r\nMoved preamble/header/footer to one file.\r\nAdded support for PostgreSQL and Informix\r\nAdded cache control in site manager ( possibility to clear cache )\r\nAdded site.ini editing under site manager\r\nAdded custom php/html file upload/edit in sistemanager\r\nAdded possibility to override sender info when sending bulkmails with settings in site.ini\r\nAdded mail to friend script\r\nAdded time un/publising on eZ article\r\nAdded site map and special front page in eZ article (user site)\r\nAdded dynamic generation of site title and meta information.\r\nAdded internal messaging with the module eZ message.\r\nAdded logging on articles, history of article changes.\r\nAdded author list and author select on eZ article.\r\nAdded topic to eZ article.\r\nAdded attributes to eZ article.\r\nAdded eZ quiz module.\r\nAdded eZ form module.\r\nFixed timeout problem in bulkmail loop to avoid time outs when sending e-mails</bullet></page></body></article>',1,'',1,1003329949,1003249288,1003249289,1,1,'qdom eZ publish&amp;trade; version 2.2 offers great improvements since 2.1. The highlights include: PostgreSQL support, template based tags in eZ article and trade, user defined article/trade tags, dynamic form creation, support for media files ( flash, quick time, mpeg etc ) section support.Full changelog 2.1   Added radiobuttons, checkboxes, dropdown lists multiple choice lists Search contact now searches online addresses phone numbers Fixed Bug count, bug archive on side. Fixed Bulkmail login Added sections to trade Added a better VAT system i voucher view Added order list/view customers Added more complete cart checkout Added SQL admin sitemanager Added fulltext search forum Fixed keywords article Added basic editor templates admin. Added customer list details trade. Added url translator. Added with Sitedesign, Template Language override. Fixed problems articles being stored invalid XML Added topic link from modification sorting categories. Added image caption override tag Added article. Now handles stop words word freqyency. Fixed searching filemanager Added setting set if can see the calendar of every user Added mage consultations visible everyone Added posibility add an appointment entire day calendar Added make upload permission filemanager folders imagecatalogue buttons buy file folder person/company list Added display which articles/products is used in Added mime types known office documents filemanger Added copy categories admin Added site Added imagecatalogue Added IP or Cookie vote checking poll Added custom site.ini Added XML generator/renderer circular option keeping case manual changing message limit forum mail Added Signature eZMail, fixed Preview button bug. Added auto check mail, show unread mail features eZMail (user configurable) Added caching next/previous vouchers editors group new module mediacatalogue; movies etc.. Added view templates. Added discussion polls Moved preamble/header/footer one file. Added Informix Added cache control site manager possibility clear ) Added site.ini editing under manager Added php/html upload/edit sistemanager Added sender info when sending bulkmails settings friend script Added time un/publising map special front page site) Added generation title meta information. Added internal messaging message. Added logging articles, history changes. Added author select article. Added attributes quiz module. Added module. Fixed timeout problem bulkmail loop avoid outs e-mails ',0,0,0,0,'');
INSERT INTO eZArticle_Article VALUES (4,'Feedback form','<?xml version=\"1.0\"?><article><generator>qdom</generator>\n<intro>This article will show how you can use pre defined forms to get feedback from the users on your site.</intro><body><page><form />\r\n<image id=\"1\" align=\"right\" size=\"medium\" /></page></body></article>',1,'',1,1003329917,1003249366,1003249367,1,1,'qdom This article will show how you can use pre defined forms to get feedback from the users on your site.  ',0,0,0,0,'');
INSERT INTO eZArticle_Article VALUES (5,'Advanced eZ article tags','<?xml version=\"1.0\"?><article><generator>qdom</generator>\n<intro>This article will show some of the more advanced eZ publish&amp;trade; renderer functionality. </intro><body><page><header level=\"1\">Custom HTML tags</header>\r\n\r\n<bold>Note:</bold> It\'s not recommended to use html tags if you plan to export the contents of the article to another format ( PDF export will soon be available in eZ publish ). You should rather define your own tags ( done in site.ini ).\r\n\r\n<html>\r\n&lt;h2&gt;This is an example of HTML inside an article&lt;/h2&gt;\r\nHere you can do &lt;font color=\"#559955\"&gt;whatever&lt;/font&gt; you want.\r\n</html>\r\n\r\n<image id=\"1\" align=\"left\" size=\"medium\" href=\"developer.ez.no\" />Lorem ipsum dolor sit amet, consectetaur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla\r\n pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum Et harumd und lookum like Greek to me, dereud facilis est er expedit distinct\r\n\r\n<image id=\"2\" align=\"right\" size=\"medium\" href=\"developer.ez.no\" />\r\nLorem ipsum dolor sit amet, consectetaur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla\r\n pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum Et harumd und lookum like Greek to me, dereud facilis est er expedit distinct\r\n\r\n<header level=\"1\">Showing code</header>\r\nIf you want to write a technical article with special characters link XHTML, XML or similiar you can use the <bold>pre</bold> tag.\r\n\r\n<pre>\r\n&lt;xml&gt;\r\n&lt;item attr=\"foo\"&gt; bar &lt;/item&gt;\r\n&lt;/xml&gt;\r\n</pre>\r\n</page></body></article>',1,'',1,1003318302,1003251862,1003251888,1,1,'qdom This article will show some of the more advanced eZ publish&amp;trade; renderer functionality. Custom HTML tags   Note: It\'s not recommended to use html tags if you plan export contents another format ( PDF soon be available in publish ). You should rather define your own done site.ini ).    &lt;h2&gt;This is an example inside article&lt;/h2&gt; Here can do &lt;font color=\"#559955\"&gt;whatever&lt;/font&gt; want.    Lorem ipsum dolor sit amet, consectetaur adipisicing elit, sed eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi aliquip ex ea commodo consequat. Duis aute irure reprehenderit voluptate velit esse cillum eu fugiat nulla  pariatur. Excepteur sint occaecat cupidatat non proident, sunt culpa qui officia deserunt mollit anim id est laborum Et harumd und lookum like Greek me, dereud facilis er expedit distinct    Lorem distinct   Showing code If want write a technical with special characters link XHTML, XML or similiar pre tag.    &lt;xml&gt; &lt;item attr=\"foo\"&gt; bar &lt;/item&gt; &lt;/xml&gt;    ',0,0,0,0,'');
